/home/deza604/ferrytime/new-frontend/src.query:
query Home {
  allSitePage(filter: {path: {regex: "/^\\/route/"}}, sort: {fields: path, order: ASC}) {
    edges {
      node {
        path
        context {
          id
          route_name
        }
      }
    }
  }
}

sq--src-components-seo-js.query:
query DefaultSEOQuery {
  site {
    siteMetadata {
      title
      description
      author
    }
  }
}
